// ステージ1-1 マップ
void DrawMapChip_2_1_1() {

	int x, y, layer;

	for (layer = 0; layer < MAPSIZE2_1_1_LAYER; layer++)
	{
		for (y = 0; y < MAPSIZE2_1_1_H; y++)
		{
			for (x = 0; x < MAPSIZE2_1_1_W; x++)
			{
				int layerstart = MAPSIZE2_1_1_W * MAPSIZE2_1_1_H * layer;
				int index = y * MAPSIZE2_1_1_W + x;
				int pos_x = x * CHIPSIZE_W - cv.view_x;
				int pos_y = y * CHIPSIZE_H - cv.view_y;
				int chip_no = nMap_2_1_1[layerstart + index];
				// .tmxのcsv形式は、透明を0とし、画像のチップは[1]から始まる。
				// そのため、全体的に数値を-1する。透明は-1となるので、if判定を追加
				chip_no--;
				if (chip_no >= 0)
				{
					DrawMemTh(pos_x, pos_y, cgChip2[chip_no]);

				}
			}
		}
	}
}

